/**
 * @param {string} start
 * @param {string} target
 * @return {boolean}
 */
const canChange = function (start, target) {
  let startPoint = 0;
  let targetPoint = 0;

  while (startPoint < start.length || targetPoint < target.length) {
    while (startPoint < start.length && start[startPoint] === '_') {
      startPoint++;
    }
    while (targetPoint < target.length && target[targetPoint] === '_') {
      targetPoint++;
    }

    if (startPoint === start.length && targetPoint === target.length) {
      return true;
    }

    if (startPoint === start.length || targetPoint === target.length) {
      return false;
    }

    if (start[startPoint] !== target[targetPoint]) {
      return false;
    }

    if ((start[startPoint] === 'L' && startPoint < targetPoint) || (start[startPoint] === 'R' && startPoint > targetPoint)) return false;

    startPoint++;
    targetPoint++;
  }

  return true;
};

